// JavaScript source code
import React from 'react';
import './SearchBar.css';

function SearchBar(props) {
    return (
        <div className="SearchBar">
            <img src="https://img.icons8.com/android/24/000000/search.png" onClick={() => props.Clicked} />
            <input className="SearchBar-Input" placeholder="Search by Title" onChange={ props.Change} />
            
       </div>
       );
}

export default SearchBar;
